import React, {useState} from 'react'

const Data = () => {
    const [node, setNode] = useState({
        nodes: [{ id: "Harry" }, { id: "Sally" }, { id: "Alice" }],
        links: [
          { source: "Harry", target: "Sally" },
          { source: "Harry", target: "Alice" }
        ]
    })
    return( 
       {node}
    )
};

export default Data
